  input: TEXT,F3XN,,"In this report, you will find an unitemized contribution for
    $5,194.29, which was an excess of cash on hand in the bank account for the PAC,
    which dates back prior to the 2003 reporting year.  We used our best efforts to
    try to fix the discrepancy, but were unable to so we are reporting the difference
    in the report.  There is no reason to believe these monies were permissible or
    unpermissible.  On 12/21/2004, I spoke with Alissa Sagrai regarding this discrepancy
    and was told to log the difference as an unitemized contribution, which is done
    in this 2004 January Year End report.  In addition, I called Abby at the FEC on
    1/18/2005 to confirm this before filing.  If you have any questions, please contact
    Helen Kim at 202-466-7200 ext. 239.  Thank you."
